import React from 'react';
import {
  Typography,
} from '@material-ui/core';
import AddTodo from "../components/AddTodo";
import Grid from "@material-ui/core/Grid"

export default () => (
    <div>
      <Grid container spacing={3}>
      <h3> ToDo</h3>
      <Grid item xs={12}>
      <Grid container spacing={3}>
    <AddTodo />
        </Grid>
      </Grid>
      </Grid>
    </div>
);
